  }

  onFailure(error) {
    console.log(error);
  }

  renderButton() {
    gapi.signin2.render('my-signin2', {
      'scope': 'profile email',
      'width': 240,
      'height': 50,
      'longtitle': true,
      'theme': 'dark',
      'onsuccess': onSuccess,
      'onfailure': onFailure
    });
  }
  render() {

    return (


      <
      div class = "g-signin2"
      data-width = "300"
      data-height = "200"
      data-longtitle = "true" / >
    );

  }

}
